    const [sectionsState] = useState();
    return (
        <div className='directory-menu'>
            {
                sectionsState.map(({ id, ...otherSectionsProps}) =>(
                    <MenuItem 
                    key={id}
                    { ...otherSectionsProps }
                    />
                ))
            }
        </div>
    )
}
